import React from "react";
import "./Sectionthree.scss";

const Sectionthree = () => {
    return (
        <div>
            <div className="Sectionthree">
                <div className="Sectionthreep1">
                    <div className="s3h1 gradient">Have A Look At Our Work</div>
                    <div className="s3h2">See Our Latest Projects</div>
                </div>
                <div className="Sectionthreep2">
                    <div className="Sectionthreep2left">
                        <div></div>
                        <div></div>
                    </div>
                    <div className="Sectionthreep2right">
                        <div></div>
                        <div></div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Sectionthree;
